%[text] %[text:anchor:T_E6D18A7A] # Segmenting Brightfield Micrographs 
%[text] %[text:anchor:H_BE06CD71] ## In Class Exercise 
%[text] %[text:anchor:T_6561FB26] In this class exercise, we will step through the process of segmenting histological images that were captured using a Bright Microscope.
%[text] Whenever you are starting with digital processing, you should review how the image was created. For example, was the image created as an RGB truecolor, using an image sensor with a BAYER filter. Or was the image captured as a series of grayscale images (as in fluorescent microscopy), and then merged to look like an RGB image? We review these steps with the following exercises
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:T_3E791E3A] # 
%%
%[text] ## Exercise: Tumor
%[text] Clear all Outputs
%[text] Read in the following image
clearvars
clc
close all
mmSetUnitDataFolder(2);
p.rgb = imread("putative_tumor.png");

figure;
imshow(p.rgb)
%[text] - Brightfield or Fluorescent?
%[text] - truecolor? (Captured by a Bayer filter?) \
%%
%[text] Display the three channels of ***p.rgb*** with their histograms
figure;
mmShowHist(p.rgb)
%[text] - How would you segment this putative tumor?
%[text] - There is not a lot of color contrast to work with.  \
%%
%[text] ### Segment by Texture
%[text] Let's try segmenting by texture. It seems busier inside the tumor vs outside the tumor. Remember, the course function mmGetTextureFilters helps prototype the different types of texture filters
p.rgb = p.rgbs;
p = mmGetTextureFilters(p,true(7));
figure
mmShowStruct(p)
%[text] - The standard deviation filter has reasonable contrast \
%[text] 
%%
%[text] #### Exploring Neighborhoods
%[text] Looks like the standard deviation filter worked the best. But did we choose the right Neighborhood? Lets test the following Neighborhoods: \[3 5 7 15 21 51\].
%[text] - Update the following FOR LOOP to try other neighborhoods for the Standard Deviation filter.  \
figure
tiledlayout("flow","TileSpacing","none")

NH =  [3 5 7 15 21 51];

for n=1:numel(NH)
    stdf = stdfilt(p.gray,true(NH(n)));
    stdf = rescale(stdf);

    nexttile
    imshow(stdf)
    text(20,20,num2str(NH(n)),'Color','m',FontWeight='bold')
end
%[text] 
%%
%[text] #### Final Neighborhood
%[text] Which Neighborhood looks the best?
%[text] - Let's update ***p.std*** using a standard deviation filter with a neighborhood of 15.
%[text] - Rescale
%[text] - display the filtered image \
p.std = stdfilt(p.gray,true(15));
p.std = rescale(p.std);
clf
imshow(p.std)
%[text] 
%%
%[text] ### Segment filtered image
%[text] Before we binarize the image, we should smooth out the tumor even more using a guassian filter. 
%[text] 1. Apply a gaussian filter to ***p.std***. Use a sigma of 7. Assign to  ***p.stdg***
%[text] 2. Binarize the filtered image. Save as ***p.mask***.
%[text] 3. Display your results \
p.stdg = imgaussfilt(p.std, 7);
p.mask = imbinarize(p.stdg);
p.mask = bwareaopen(p.mask, 3000);
p.mask = imfill(p.mask, 'holes');
p.mask = imopen(p.mask,strel('disk',15));
imshowpair(p.rgb,p.mask)

%%
%[text] ### Try SAM
%[text] Select the Segment Anything Tools
imageSegmenter(p.rgb)
%%
%[text] ### Automate SAM
%[text] Do we need manually click on the image ourselves? The function `imsegsam` automates searching for objects in the image
p.sz = bwarea(p.mask)
[masks,scores] = imsegsam(p.rgb,MinObjectArea=50000,ScoreThreshold=0.65,Verbose=false);
%%
automask = false(masks.ImageSize);
automask(masks.PixelIdxList{:})=true;
imshowpair(p.rgb,automask)
%%
%[text] ## Exercise: LungHist700 Dataset
%[text] In this example, we will open a subset for the LungHist700 dataset, which is a dataset of histological images for deep learning in pulmonary pathology. In this dataset are 691 high-resolution (1200 Ã— 1600 pixels) histopathological lung images, covering adenocarcinomas, squamous cell carcinomas, and normal tissues from 45 patients.
%[text] For this exercise, we will focus on the keratinization that occurs in squamous cell carcinomas.
%[text] ![](text:image:7dc9)
%[text] You can find the `LungHist700` folder in the `MtMdata/unit2` folder. The following sets a path to a folder containing well differentiated squamous cell carcinomas (scc\_bd).
clearvars
image_folder = fullfile(mmSetUnitDataFolder(2),"lungHist700","images","scc_bd") % create path to image files
contents = dir(fullfile(image_folder,'*.jpg')) % get info on the image files in the scc_bd folder
%[text] - There are 99 images in the scc\_bd folder \
%%
%[text] ### Processing the File names
%[text] Image names are often named with identifiers separated by a delimiter, like the underscore symbol. This makes separate the id info easy, as follows
name = string(contents(1).name)
name = extractBefore(name,'.jpg')
str = split(name,'_')'
%[text] - **scc** - squamous cell carcinomas
%[text] - **bd** - well differentiated
%[text] - **20X** - image magnification
%[text] - **301** - image ID \
%%
%[text] We can easily build a table containing all data, as follows
names = string({contents.name})'; % get all the file names
names = extractBefore(names,'.jpg'); % remove the extension
allT = array2table(split(names,"_"),"VariableNames",["Disease" "Progression" "Mag" "ID"]);
allT.File = names % it's a good idea to keep the filename too
%%
%[text] ### Display Images
image_path = fullfile(image_folder,contents(1).name)
p.rgb = imread(image_path);
figure
imshow(p.rgb)
%%
%[text] ### Median Filter exploration
%[text] Segmentation is often improved if you filter the image first. Here, we try a series of median filters to decide which is the best. This time we will use **medfilt3**, since the image is a rgb image. Notice that our neighborhood looks a little different. We need 3 values instead of just 2. 
% create Neighborhood Matrix
nHoods = [3 3 1; 5 5 1; 7 7 1; 9 9 1; 21 21 1]; %

figure;
tiledlayout("flow","TileSpacing","tight","Padding","tight");
nexttile
imshow(p.rgb);
title('original')

for n=1:size(nHoods,1)
    nexttile
    imshow(medfilt3(p.rgb, nHoods(n,:)));
    title(sprintf('%d x %d X %d',nHoods(n,:)))
end
%[text] - Add a 7X7 and 9x9 neighborhood and re-run \
%%
p.medf = medfilt3(p.rgb, [7 7 1]); % 7 7 1 for the win
%%
%[text] ### Color Thresholding
%[text] We are trying to threshold regions of keratinization, which stain pink in H&E staining. Let's use the colorThresholder to establish thresholds for eosinophil in the L\*a\*b\* color space.
colorThresholder(p.rgb)
%[text] - Convert the image to L\*a\*b\* space
%[text] - Threshold the eosinophil using the lasso capture
%[text] - Export your settings as a function when you are done. \
%%
%[text] I created the function `segmentKeratin using colorThresholder. Let's use it on our filtered image`
p.mask = segmentKeratin(p.medf);
figure;
mmShowBurnImage(p.rgb,p.mask)
%%
%[text] ### Clean up Noise
p.mask = bwareaopen(p.mask, 250);

mmTightTiledLayout % horizontal, no spacing in tiles. figure call built-in
displayOutcome(p)

function displayOutcome(p)
% displays original image and blended image, side by size,
%   with linked zooming turned on
ax(1) = nexttile; % get axis handle
imshow(p.rgb) % original image

ax(2) = nexttile; % concatenate second axis handle
imshowpair(p.rgb,p.mask,'blend') % blended image
linkaxes(ax,'xy') % link zoom on axes
end
%%
%[text] ### Try the Next image
n = 1;
image_path = fullfile(image_folder,contents(n).name)
p.rgb = imread(image_path);
p.medf = medfilt3(p.rgb, [7 7 1]); % 7 7 1 for the win
p.mask = segmentKeratin(p.medf);
p.mask = bwareaopen(p.mask, 250);

mmTightTiledLayout
displayOutcome(p)
%%
%[text] ### A FOR LOOP to segment them all
%[text] Now we have all the steps we need to generate some data. We'll package our FOR LOOP in a function for later use.
function reviewSegmentation(contents)
figure
tiledlayout(5,4,"TileSpacing","none","Padding","tight") % need a different tiled layout
for n=1:10
    image_path = fullfile(contents(n).folder,contents(n).name);
    p.rgb = imread(image_path);
    p.medf = medfilt3(p.rgb, [7 7 1]); % 7 7 1 for the win
    p.mask = segmentKeratin(p.medf);
    % p.mask = captureBackground(p.medf);
    p.mask = bwareaopen(p.mask, 250);
    displayOutcome(p)
    text(100,100,num2str(n),'Color','w','FontSize',9) % add the image number in top right corner
end
end
%%
%[text] ### Analysis
%[text] Once we are happy with our segmentations we can analyze the extent of the keratinization by summing the total area of the mask. We can also create a ratio of keratinization to total tissue by dividing the area of the keratination by the total area of the tissue. We have already created a table, T, containing the information about  each tissue. So, we'll just add our data to the proper row in the table. We'll just add a couple of columns to the table to handle our new table. Also, let's restrict our analysis to "20X" images only so that's we what prototyped our analysis on.
T = allT(allT.Mag=="20x",:); % keep only rows with 20X in them
T = count_Keratin(T);

function T = count_Keratin(T)

% preallocate column in table
T.Keratin = zeros(height(T),1);
T.Tissue = T.Keratin;
T.Ratio = T.Keratin;

% FOR LOOP
for n=1:height(T)
    image_path = fullfile(image_folder,contents(n).name);
    p.rgb = imread(image_path);
    p.medf = medfilt3(p.rgb, [7 7 1]); % 7 7 1 for the win
    p.mask = segmentKeratin(p.medf);
    p.mask = bwareaopen(p.mask, 250);

    % capture data
    T.Keratin(n) = bwarea(p.mask); % total area of keratin
    p.background = captureBackground(p.rgb);
    T.Tissue(n) = bwarea(~p.background); % everything not background is tissue
    T.Ratio(n) = T.Keratin(n)/T.Tissue(n); % Keratin / Tissue
end
end
%%
%[text] ## Next Dataset
image_folder = fullfile(mmSetUnitDataFolder(2),"lungHist700","images","nor"); % create path to  normal image files
contents = dir(fullfile(image_folder,'*.jpg')); % get info on the image files in the scc_bd folder

names = string({contents.name})'; % get all the file names
names = extractBefore(names,'.jpg'); % remove the extension
t = array2table(split(names,"_"),"VariableNames",["Disease" "Mag" "ID"]);
t.File = names % it's a good idea to keep the filename too
t = t(t.Mag=="20x",:) % just keep the 20X rows
t.Progression = strings(height(t),1); % no progression info for normal tissue
t = movevars(t,"Progression","After","Disease");
%%
%[text] ### Review Segmentation
%[text] Does the segmentation work for this dataset
reviewSegmentation(contents)
%%
%[text] ### Run the Analysis
t = count_Keratin(t); % use function from above
%%
%[text] ### Concatenate Data
T = [T;t];
T = convertvars(T,["Disease" "Progression" "Mag"],'categorical');
summary(T)
%%
%[text] ### Visualize Results
figure;
mmBoxSwarm(T.Disease,T.Ratio)
%%
function [BW,maskedRGBImage] = segmentKeratin(RGB)
%createMask  Threshold RGB image using auto-generated code from colorThresholder app.
%  [BW,MASKEDRGBIMAGE] = createMask(RGB) thresholds image RGB using
%  auto-generated code from the colorThresholder app. The colorspace and
%  range for each channel of the colorspace were set within the app. The
%  segmentation mask is returned in BW, and a composite of the mask and
%  original RGB images is returned in maskedRGBImage.

% Auto-generated by colorThresholder app on 24-Sep-2025
%------------------------------------------------------


% Convert RGB image to chosen color space
I = rgb2lab(RGB);

% Define thresholds for channel 1 based on histogram settings
channel1Min = 43.959;
channel1Max = 58.675;

% Define thresholds for channel 2 based on histogram settings
channel2Min = 36.186;
channel2Max = 72.674; % 68.174

% Define thresholds for channel 3 based on histogram settings
channel3Min = -35.732;
channel3Max = -17.970;

% Create mask based on chosen histogram thresholds
sliderBW = (I(:,:,1) >= channel1Min ) & (I(:,:,1) <= channel1Max) & ...
    (I(:,:,2) >= channel2Min ) & (I(:,:,2) <= channel2Max) & ...
    (I(:,:,3) >= channel3Min ) & (I(:,:,3) <= channel3Max);
BW = sliderBW;

% Initialize output masked image based on input image.
maskedRGBImage = RGB;

% Set background pixels where BW is false to zero.
maskedRGBImage(repmat(~BW,[1 1 3])) = 0;

end

function [BW,maskedRGBImage] = captureBackground(RGB)
%createMask  Threshold RGB image using auto-generated code from colorThresholder app.
%  [BW,MASKEDRGBIMAGE] = createMask(RGB) thresholds image RGB using
%  auto-generated code from the colorThresholder app. The colorspace and
%  range for each channel of the colorspace were set within the app. The
%  segmentation mask is returned in BW, and a composite of the mask and
%  original RGB images is returned in maskedRGBImage.

% Auto-generated by colorThresholder app on 25-Sep-2025
%------------------------------------------------------


% Convert RGB image to chosen color space
I = rgb2lab(RGB);

% Define thresholds for channel 1 based on histogram settings
channel1Min = 69.290;
channel1Max = 80.357;

% Define thresholds for channel 2 based on histogram settings
channel2Min = -0.912;
channel2Max = 7.628;

% Define thresholds for channel 3 based on histogram settings
channel3Min = -5.368;
channel3Max = 3.137;

% Create mask based on chosen histogram thresholds
sliderBW = (I(:,:,1) >= channel1Min ) & (I(:,:,1) <= channel1Max) & ...
    (I(:,:,2) >= channel2Min ) & (I(:,:,2) <= channel2Max) & ...
    (I(:,:,3) >= channel3Min ) & (I(:,:,3) <= channel3Max);
BW = sliderBW;

% Initialize output masked image based on input image.
maskedRGBImage = RGB;

% Set background pixels where BW is false to zero.
maskedRGBImage(repmat(~BW,[1 1 3])) = 0;

end

